from keras import backend as K
from keras.models import load_model
from keras import Sequential, optimizers, losses
from keras.layers import Conv1D, AveragePooling1D, Flatten, Dense, Reshape, Activation, BatchNormalization, Dropout, \
    MaxPooling1D
from keras.utils import to_categorical, np_utils
import numpy as np
import time

from BN16 import BatchNormalizationF16
from guppy import hpy
h = hpy()

def make_model():
    K.set_floatx('float32')
    model = Sequential()
    model.add(Reshape((47165, 1), input_shape=(47165,)))
    model.add(Conv1D(256, 8, padding='same', input_shape=(47165, 1)))  # X_train.shape[1] = No. of Columns
    model.add(Activation('relu'))
    model.add(Conv1D(256, 8, padding='same'))
    model.add(BatchNormalizationF16())
    model.add(Activation('relu'))
    model.add(Dropout(0.25))
    model.add(MaxPooling1D(pool_size=(8)))
    model.add(Conv1D(128, 8, padding='same'))
    model.add(Activation('relu'))
    model.add(Conv1D(128, 8, padding='same'))
    model.add(Activation('relu'))
    model.add(Conv1D(128, 8, padding='same'))
    model.add(Activation('relu'))
    model.add(Conv1D(128, 8, padding='same'))
    model.add(BatchNormalizationF16())
    model.add(Activation('relu'))
    model.add(Dropout(0.25))
    model.add(MaxPooling1D(pool_size=(8)))
    model.add(Conv1D(64, 8, padding='same'))
    model.add(Activation('relu'))
    model.add(Conv1D(64, 8, padding='same'))
    model.add(Activation('relu'))
    model.add(Flatten())
    model.add(Dense(7))  # Target class number
    model.add(Activation('softmax'))
    return model


loaded_model_f32 = load_model("model.h5")
K.set_floatx('float16')
ws = loaded_model_f32.get_weights()
wsp = [np.nan_to_num(w.astype(K.floatx())) for w in ws]
loaded_model_f16 = make_model()
loaded_model_f16.set_weights(wsp)

loaded_model_f32.summary()
